OFFLINE photo translator and dictionary -- the ultimate foreign language tool when you are abroad! Translates sentences without data connection between English and German in offline mode. A must have if you travel to foreign countries - save on data roaming charges!

Our unique translation technology often delivers translations that excel both Google Translate, Microsoft Translator and Yandex while using much less storage space.
It also allows more language pairs than other paid apps having offline translation such as iTranslate and PROMT.

FREE VERSION
- you will be reminded to support us by using one of our paid apps;

TRANSLATION
- translates from and to German and English;
- fully functional translation without any internet connection;

PHOTO/PICTURE TRANSLATION AND OCR
- take a picture of printed text and translate it in seconds offline! 
- available for both English and German; 
- use this feature to easily convert photos of printed text into editable text in offline mode; 

DICTIONARY
- dictionary between German and English;
- recognizes any word form and identifies its features (number, person, gender, etc.)
- displays all the translations for a given word;
- displayed for single words when hitting the Translate button;
- allows reading individual words by tapping the desired word in the translation;

VOICE
- voice output for both German and English
- allows reading individual words by tapping the desired word in the translation;

You can test the translation without buying the app at http://www.offline-translator.com

Help us improve the translation quality (and get a free update) by translating text and suggesting better translations for SkyCode at http://itranslate4.eu

If you encounter problems with the app, please contact our customer support!
